INSERT INTO `doctor` VALUES ('1001001','1001','张如湾','男','','1001001@hospital.com','13888888888','123456','中华医学会老年医学分会第八届委员会青年委员、中国医师协会呼吸医师分会首届中青年医师工作委员会青年委员、江西省医学会老年医学分会第六届委员会常务委员、江西省医学会第六届呼吸病分会介入呼吸学组副组长、华东地区介入肺脏病学协作组委员。江西省卫生系统学术和技术带头人第四批培养对象。2013年“远航工程”资助对象。经支气管镜介入技术：如气道内支架置入、经支气管镜氩气、冷冻、球囊扩张术治疗各种气道良恶性疾病。','呼吸系统疾病的介入治疗，肺癌、间质性肺疾病诊疗。 学术任职、科研成果：科副主任、主任医师、医学博士、教授、硕士/博士研究生导师，中华医学会老年医学分会第八届委员会青年委员、中国医师协会呼吸医师分会首届中青年医师工作委员会委员、江西省研究型医院学会呼吸病分会第一届委员会副主任委员、江西省整合医学会呼吸分会副主任委员。','主任医师','科室主任'),('1001002','1001','杨洋','女','','1001002@hospital.com','13999999999','123456','南昌大学第二临床医学院内科教授、内科教研室副主任，硕士研究生导师，南昌大学第二附属医院主任医师，大内科副主任，呼吸科主任。江西省医学会理事、江西省呼吸学会副主任委员、江西省睡眠医学会副会长；《江西医药》、《南昌大学学报－医学版》特约审稿人；省人事厅、省科委、省高教委、省卫生厅等专家库成员。','慢性阻塞性肺疾病、支气管哮喘、慢性咳嗽、间质性肺疾病、肺部感染、呼吸疑难、危重症及少见、罕见病、肺结节影像分析等疾病的诊断与治疗。 学术任职、科研成果：主任医师、教授，中国医师协会呼吸病学分会委员、中国老年医学会呼吸病分会委员、中国研究型医院学会呼吸病学分会委员，先后主持或参加了国家自然科学基金、科技部项目，省自然科学基金20余项。','医生','医生'),('1001003','1001','刘一鸣','男','','1001003@hospital.com','13666666666','123456','副教授、博士、硕士生导师。江西省医学会内科学分会青年委员，2017年上海“长海医院-美国亨利福特医院国际介入肺脏病学中心”进修学习，主持国家自然科学基金、江西省自然科学基金、江西省科学技术厅、教育厅、卫生厅课题等多项，获国家发明专利1项。','擅长呼吸系统疑难及重症的诊治，在肺癌、慢性阻塞性肺疾病、肺动脉高压、肺心病和呼吸衰竭、呼吸机技术方面有深入研究，研究方向：肺部肿瘤的基因与免疫治疗及呼吸慢病的诊治。 学术任职、科研成果：美国佐治亚医学院肿瘤中心访问学者、江西省医学会内科学分会青年委员、江西省医师协会呼吸医师分会委员，主持国家自然科学基金2项、省级及厅级课题多项，获国家发明专利2项，在国内核心期刊及国际SCI期刊上发表论文20余篇。','医生','医生'),('1001004','1001','王丽媛','女','','1001004@hospital.com','13777777777','123456','南昌大学第二临床医学院内科教授、内科教研室副主任，硕士研究生导师，南昌大学第二附属医院主任医师，大内科副主任，呼吸科主任。江西省医学会理事、江西省呼吸学会副主任委员、江西省睡眠医学会副会长；《江西医药》、《南昌大学学报－医学版》特约审稿人；省人事厅、省科委、省高教委、省卫生厅等专家库成员。','慢性阻塞性肺疾病、支气管哮喘、慢性咳嗽、间质性肺疾病、肺部感染、呼吸疑难、危重症及少见、罕见病、肺结节影像分析等疾病的诊断与治疗。 学术任职、科研成果：主任医师、教授，中国医师协会呼吸病学分会委员、中国老年医学会呼吸病分会委员、中国研究型医院学会呼吸病学分会委员，先后主持或参加了国家自然科学基金、科技部项目，省自然科学基金20余项。','主治医师','医生'),('1001005','1001','梁思成','男','','1001005@hospital.com','13555555555','123456','江西中西医结合呼吸学会常务委员、江西省睡眠医协会呼吸专业委员会常务理事。','哮喘、肺部感染、肺癌及戒烟干预、睡眠呼吸障碍性疾病方面有专业特长。 学术任职、科研成果：主任医师，硕士研究生导师，江西中西医结合呼吸学会常务委员、江西省睡眠医协会呼吸专业委员会常务理事。','医生','医生'),('1002001','1002','张朝阳','男','','1002001@hospital.com','13800000000'